import Link from "next/link";
import Header from "../components/header";
import Logo from "../components/Logo";

export default () => (
  <main>

    <div className="center">
      <Header />
      <Logo/>
    </div>


    <style jsx>{`

.center{
  display: flex;
  justify-content: center;
}
`}</style>
  </main>
);
